    $.initCategory = function (data) {
        var category = [];
        var ids = data.map(x => x.PS_PS_CATEGORY_ID);
        data.filter(x => !x.PARENT_ID || ids.indexOf(x.PARENT_ID) < 0).sort((a, b) => {
            if (a.PS_PS_CATEGORY_NAME < b.PS_PS_CATEGORY_NAME) { return -1; }
            if (a.PS_PS_CATEGORY_NAME > b.PS_PS_CATEGORY_NAME) { return 1; }
            return 0;
        }).map(item => {
            item.label = item.PS_PS_CATEGORY_NAME;
            item.value = item.PS_PS_CATEGORY_ID;
            category.push(item);
            var child = data.filter(x => x.PARENT_ID === item.PS_PS_CATEGORY_ID);
            child.sort((a, b) => {
                if (a.PS_PS_CATEGORY_NAME < b.PS_PS_CATEGORY_NAME) { return -1; }
                if (a.PS_PS_CATEGORY_NAME > b.PS_PS_CATEGORY_NAME) { return 1; }
                return 0;
            }).map(item2 => {
                item2.label = '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- ' + item2.PS_PS_CATEGORY_NAME;
                item2.value = item2.PS_PS_CATEGORY_ID;
                category.push(item2);
                var child2 = data.filter(x => x.PARENT_ID === item2.PS_PS_CATEGORY_ID);
                child2.sort((a, b) => {
                    if (a.PS_PS_CATEGORY_NAME < b.PS_PS_CATEGORY_NAME) { return -1; }
                    if (a.PS_PS_CATEGORY_NAME > b.PS_PS_CATEGORY_NAME) { return 1; }
                    return 0;
                }).map(item3 => {
                    item3.label = '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+ ' + item3.PS_PS_CATEGORY_NAME;
                    item3.value = item3.PS_PS_CATEGORY_ID;
                    category.push(item3);
                });
            });
        });
        return category;
    };

