    $.postStringify = function (url, data, isAsync, callback) {
        var request = {
            url: url,
            dataType: 'json',
            contentType: 'application/json',
            data: JSON.stringify(data),
            type: 'POST',
            async: isAsync,
            success: function (response) {
                if (callback != null && callback != undefined) {
                    callback(response);
                } else {
                    if (response.Success) {
                        alertify.alert('Thông báo', response.Message, 'Đóng');
                    } else {
                        alertify.alert('Lỗi', response.Message, 'Đóng');
                    }
                }
            },
            error: function (error) {
                console.log(error);
            }
        };
        if ($('input[name="__RequestVerificationToken"]') && $('input[name="__RequestVerificationToken"]').length > 0) {
            var token = $('input[name="__RequestVerificationToken"]').val();
            request.beforeSend = function (request) {
                request.setRequestHeader("__RequestVerificationToken", token);
            };
        }
        $.ajax(request);
    };

    $.fn.submitForm = function (callback) {
        var url = $(this).attr('action');
        var $form = $(this);
        if ($form.valid()) {
            var obj = $(this).serializeObject();
            $.postStringify(url, obj, true, function (response) {
                if (response.Success) {
                    if (callback != null && callback != undefined) {
                        callback(response);
                    } else {
                        alertify.alert(response.Message)
                    }
                } else {
                    $('label.error').hide();
                    $('input').removeClass('error');
                    if (response.Errors == null || response.Errors == undefined) {
                        alertify.alert(response.Message)
                    } else {
                        var message = "";

                        var listErrors = Object.values(response.Errors);
                        for (var idx = 0; idx < listErrors.length; idx++) {
                            debugger
                            message += listErrors[idx];
                            if (idx < listErrors.length - 1)
                                message += ', ';
                        }
                        if (message.length > 0) {
                            alertify.alert('Thông báo', message);
                        }
                    }
                }
            });
        } else {
            if (validator && validator.showErrors) {
                validator.showErrors(validator.errorMap, validator.errorList);
            }
            $(this).focusFirstErrorInput();
        }
    };

    $.fn.submitFormJson = function (callback) {
        var url = $(this).attr('action');
        if ($(this).valid()) {
            var obj = {
                json: JSON.stringify($(this).serializeObject())
            };
            $.callAjax(url, obj, enumMethod.Post, true, function (response) {
                if (response.StatusCode == 401) {
                    window.location.href = response.Data;
                }
                if (response.Success) {
                    if (callback != null && callback != undefined) {
                        callback(response);
                    } else {
                        alertify.alert(response.Message)
                    }
                } else {
                    $('label.error').hide();
                    $('input').removeClass('error');
                    if (subValidator != null && subValidator != undefined) {
                        subValidator.showErrors(response.Errors);
                    } else {
                        validator.showErrors(response.Errors);
                    }
                    if (response.Errors == null || response.Errors == undefined) {
                        alertify.alert(response.Message)
                    }
                }
            });
        } else {
            validator.showErrors(validator.errorMap, validator.errorList);
            $(this).focusFirstErrorInput();
        }
    };

    $.callAjax = function (url, data, method, isAsync, callback) {
        //$.appendSpin();
        $.ajax({
            url: url,
            dataType: 'json',
            data: data,
            type: method,
            async: isAsync,
            success: function (response) {
                //$.removeSpin();
                if (response.StatusCode == 401) {
                    window.location.href = response.Data;
                }
                if (callback != null && callback != undefined) {
                    callback(response);
                } else {
                    if (response.Success) {
                        $.notifySuccess(response);
                    } else {
                        $.notifyError(response);
                    }
                }
            },
            error: function (error) {
                console.log(error);
            }
        });
    };

    $.fn.serializeObject = function () {
        var o = {};
        var a = this.serializeArray();
        $.each(a, function () {
            if (o[this.name]) {
                if (!o[this.name].push) {
                    o[this.name] = [o[this.name]];
                }
                o[this.name].push(this.value || '');
            } else {
                o[this.name] = this.value || '';
            }
        });
        $(this).find('select').map(function () {
            var attrMunti = $(this).attr('multiple');
            if (typeof attrMunti !== typeof undefined && attrMunti !== false) {
                var name = $(this).attr('name');
                var value = $(this).val();
                if ($.isArray(value)) {
                    var valueJoin = value.join(",");
                    o[name] = valueJoin;
                } else {
                    o[name] = value;
                }
            }
        });
        $(this).find('input[type=checkbox]').map(function () {
            var name = $(this).attr('name');
            var value = $(this).is(":checked");
            o[name] = value;
        });

        $(this).find('input[type=radio]').map(function () {
            var name = $(this).attr('name');
            var value = $('input[name=' + name + ']:checked').val();
            o[name] = value;
        });
        return o;
    };

