    $.nonUnicode = function (str) {
        str = str.toLowerCase();
        str = str.replace(/à|á|ạ|ả|ã|â|ầ|ấ|ậ|ẩ|ẫ|ă|ằ|ắ|ặ|ẳ|ẵ/g, "a");
        str = str.replace(/è|é|ẹ|ẻ|ẽ|ê|ề|ế|ệ|ể|ễ/g, "e");
        str = str.replace(/ì|í|ị|ỉ|ĩ/g, "i");
        str = str.replace(/ò|ó|ọ|ỏ|õ|ô|ồ|ố|ộ|ổ|ỗ|ơ|ờ|ớ|ợ|ở|ỡ/g, "o");
        str = str.replace(/ù|ú|ụ|ủ|ũ|ư|ừ|ứ|ự|ử|ữ/g, "u");
        str = str.replace(/ỳ|ý|ỵ|ỷ|ỹ/g, "y");
        str = str.replace(/đ/g, "d");
        str = str.replace(/À|Á|Ạ|Ả|Ã|Â|Ầ|Ấ|Ậ|Ẩ|Ẫ|Ă|Ằ|Ắ|Ặ|Ẳ|Ẵ/g, "A");
        str = str.replace(/È|É|Ẹ|Ẻ|Ẽ|Ê|Ề|Ế|Ệ|Ể|Ễ/g, "E");
        str = str.replace(/Ì|Í|Ị|Ỉ|Ĩ/g, "I");
        str = str.replace(/Ò|Ó|Ọ|Ỏ|Õ|Ô|Ồ|Ố|Ộ|Ổ|Ỗ|Ơ|Ờ|Ớ|Ợ|Ở|Ỡ/g, "O");
        str = str.replace(/Ù|Ú|Ụ|Ủ|Ũ|Ư|Ừ|Ứ|Ự|Ử|Ữ/g, "U");
        str = str.replace(/Ỳ|Ý|Ỵ|Ỷ|Ỹ/g, "Y");
        str = str.replace(/Đ/g, "D");
        str = str.replace(/!|@|\$|%|\^|\*|\(|\)|\+|\=|\<|\>|\?|\/|,|\.|\:|\'| |\"|\&|\#|\[|\]|~/g, "-");
        str = str.replace(/-+-/g, "-"); //thay thế 2- thành 1-
        str = str.replace(/^\-+|\-+$/g, "");//cắt bỏ ký tự - ở đầu và cuối chuỗi

        return str;
    }

    $.formatDate = function (date, type) {
        if (date == undefined || date == null || date == 'Invalid Date') return '';
        var day = this.formatNumber3(date.getDate(), 2);
        var month = this.formatNumber3(date.getMonth() + 1, 2);
        var year = this.formatNumber3(date.getFullYear(), 4);
        var hours = this.formatNumber3(date.getHours(), 2);
        var minutes = this.formatNumber3(date.getMinutes(), 2);
        var seconds = this.formatNumber3(date.getSeconds(), 2);
        var result = day + '/' + month + '/' + year;
        switch (type) {
            case 'fulldate':
                result += ' ' + hours + ':' + minutes + ':' + seconds;
                break;
            case 'datetime':
                result += ' ' + hours + ':' + minutes;
                break;
            case 'timedate':
                result = hours + ':' + minutes + ' ' + result;
                break;
            case 'jsondate':
                result = date.toISOString();
                break;
        };
        return result;
    };

    // Dựa vào length để thêm số 0 trước số:
    // VD: length = 3, number = 2 => 002
    // VD: length = 3, number = 12 => 012
    $.formatNumber3 = function (number, length) {
        var result = '';
        for (var i = 0; i < length; i++) {
            result += '0';
        }
        result += number;
        return result.slice(-length);
    };

